import React from 'react'
// import Header from './Header'
import Nav from './Nav'
import { BrowserRouter as Router , Routes, Route } from 'react-router-dom'
const Home = () => {
    return (
        <div className = "home">
            
    <Routes>
     <Route path ="/" exact element = {<Nav/> } />
      
     {/* <Route path ="/" exact element = {<Header/> } /> */}
      
           
           
         </Routes>
       
        </div>
    )
}

export default Home
